import { Component } from "react";
import Home from "./pages/Home";
import PostUploadPage from "./components/items/PostUploadPage";
import ProfilePage from "./pages/ProfilePage";
import MyNetwork from "./pages/MyNetword";

const routes = [
    {path:'/', Component:Home, exact:true},
    {path:'/profile/:id', Component:ProfilePage, exact:true},
    {path:'/upload', Component:PostUploadPage, exact:true},
    {path:'/mynetwork', Component:MyNetwork, exact:true},
    {path:'/', Component:MyNetwork, exact:true},

]

export default routes;
